import './App.css';
function App() {
  const [formData,setformData]=useState({
    firstName:"",lastName:""
  })
  console.log(formData)
  function handleChange(event){
    setformData(prevForm=>{
      return{
        ...prevForm,[event.target.name]:event.target.value
      }
    })

  }
  return (
    <form>
      <input type='text' placeholder='frstname' name='firstName' onChange={handleChange}/>
      <input type='text' placeholder='lastname' name='lastName' onChange={handleChange}/>
      {formData}
    </form>


  )
};
export default App;
